function showImages(arr, page=0, quantity=100){
    document.body.innerHTML = ''
    document.body.innerHTML = '<div id="div_imgs" style="display:flex;flex-wrap: wrap"></div>'
    div_imgs.innerHTML = ''
    arr.slice(page*quantity, page*quantity+quantity).map(e=> {
        let image = new Image()
        image.src = e
        div_imgs.appendChild(image)
    }  )
}


p = 0
window.onkeyup=e=>{
    if(e.key == "ArrowUp"){ showImages(imgs, p); console.log(p) }
    if(e.key == "ArrowRight"){ showImages(imgs, ++p); console.log(p) }
    if(e.key == "ArrowLeft"){ showImages(imgs, --p); console.log(p) }
}

